import Logements from '../../backend/logements'

function gallery (){
  return <>
  <Card
    key="bla"
    label="blo"
    picture= ""
    title="job"
  />
  </>
}

function Accueil (){
  return <>
    <Banner/>
    {createCard ()}
  </>
}

function createCard (){
  let cards = [];
  for (let i = 0; i < 20; i++) {
    cards.push(<Link to="/Logement"><Card
      key="bla"
      label="blo"
      picture= <Logements
        index={i}
        pictures="picture"
      />
      title="job"
    /></Link>);
  }
  return <div style={{ display: 'flex', flewWrap: "wrap", padding: 15 }}>{cards}</div>
}

export default Accueil;
